[application]

name="alAkhira"
main_scene="res://env/scenes/testroom.xml"
icon="res://icon.png"
boot_logo=img(rgba, 0, 512, 512, )
boot_bg_color=#ff000000
target_fps=60
boot_splash="res://StudiosLUNE.png"
boot_splash_fullsize=true

[audio]

output_latency=25
mixer_interp="linear"
stream_volume_scale=1.0
stream_buffering_ms=500

[autoload]

SUTjoystick="res://scripts/SUTjoystick.gd"

[debug]

indicators_enabled=true
print_clicked_control=true
print_metrics=true
verbose_stdout=true
image_load_times=true
script_max_call_stack=1024
print_fps=true

[display]

width=800
height=600
resizable=true
stretch_mode="disabled"

[image_loader]

filter=true
gen_mipmaps=true
repeat=true

[input]

ui_accept=[key(Return), key(Enter), key(Space), jbutton(0, 0)]
ui_cancel=[key(Escape)]
ui_left=[key(Left), jbutton(0, 14)]
ui_right=[key(Right), jbutton(0, 15)]
ui_up=[key(Up), jbutton(0, 12)]
ui_down=[key(Down), jbutton(0, 13)]
move_forward=[key(W)]
move_backwards=[key(S)]
move_left=[key(A)]
move_right=[key(D)]
jump=[key(Space)]
grab=[key(E)]
cast=[key(Shift)]
dodge=[jbutton(0, 3)]
move=[]
attack=[mbutton(0, 1), key(X)]

[physics]

fixed_fps=60

[rasterizer]

shadow_filter=1
fp16_framebuffer=true
trilinear_mipmap_filter=true

[render]

thread_model=1
shadows_enabled=true
room_cull_enabled=false
light_discard_enabled=true
mipmap_policy=0
default_clear_color=#ff4c4c4c
